import React,{useEffect,useState} from 'react'
import PropTypes from 'prop-types'
import { Link, useNavigate } from 'react-router-dom'


export default function Navbar(props) {
  const navigate = useNavigate();
  const [concertData, setConcertData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:8081/CheckAdmin');
        const data = await response.json();
        if (Array.isArray(data)) {
          setConcertData(data);
        } else {
          setConcertData([]);
        }
      } catch (error) {
        console.error('Error:', error);
        setConcertData([]);
      }
    };
    fetchData();
  }, []);

  
  return (
    <div>
        <nav className={` navbar transparent navbar-expand-lg navbar-light   `}>
  <div className="container-fluid fs-3">
    {/* <Link className="navbar-brand" to="/textutils">{props.title}</Link> */}
    <button className="navbar-toggler " type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarSupportedContent">
      <ul className="navbar-nav me-auto mb-2 mb-lg-0 column-gap-3">
        <li className="btn-border">
          <a className='btn btn-border navbar-light' href="/" ><button className='btn' >Account</button></a>
        </li>
        <li className="nav-item">
          <a id='item1' className="btn btn-border" aria-current="page" href="/ShowAndBook"><button className='btn' >{props.navbar_item1}</button></a>
        </li>
        <li className="nav-item">
          <a id='item2' className="btn btn-border" aria-current="page" href="/Create"><button className='btn' >{props.navbar_item2}</button></a>
        </li>
        <li className="nav-item">
          <a id='item3' className="btn btn-border" aria-current="page" href="/ShowAndId" ><button className='btn' >{props.navbar_item3}</button></a>
        </li>
        <li className="nav-item">
          <a id='item4' className="btn btn-border" aria-current="page" href="/ShowAndDelete"><button className='btn' >{props.navbar_item4}</button></a>
        </li>
       
        
        
      </ul>
      {/* <form className="d-flex" role="search">
        <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
        <button className="btn btn-outline-success" type="submit">Search</button>
      </form> */}
      
      <div className="btn-group" role="group" aria-label="Basic mixed styles example">
  {/* <button type="button" className="btn btn-blue" style={{"backgroundColor":"blue"}}onClick={props.toggleMode}>Blue</button>
  <button type="button" className="btn btn-grey" style={{"backgroundColor":"grey"}} onClick={props.toggleModeGrey}>Grey</button> */}
  {/* <button type="button" className="btn btn-black" style={{backgroundColor:"black"}} onClick={props.toggleModeBlack}>Black</button> */}

</div>

      {/* <div className={`form-check form-switch text-${document.body.style.backgroundColor==='white'?'dark':'light'}`}>
 
  <label className="fs-4" htmlFor="flexSwitchCheckDefault">Not Signed in</label>
</div> */}
    </div>
  </div>
</nav>
    </div>
  )
}
Navbar.propTypes={
    // title:PropTypes.string,
    title:PropTypes.string.isRequired,
    about:PropTypes.string.isRequired
}
Navbar.defaultProps={
    title: "set title here",
    about:"About "
}
